import React from 'react';

const Login = ({ toggleForms }) => {
  return (
    <div className='Login'>
        <form className='form'>
            <div className="form-elements">
                <label htmlFor="email">Email</label>
                <input className='form-inputs' type="email" placeholder='Enter your Email' id="email" />
            </div>
            <div className="form-elements">
                <label htmlFor="password">Password</label>
                <input className='form-inputs' type="password" placeholder='Enter your Password' id="password" />
            </div>
            <div className="form-btn">
                <button type="submit" className='form-btn-inputs'>Login</button>
                <button type="button" onClick={toggleForms}>Need an account? Sign Up</button>
            </div>
        </form>
    </div>
  );
}

export default Login;
